import React from 'react';
import SportsTennisIcon from '@mui/icons-material/SportsTennis';
import DirectionsRunIcon from '@mui/icons-material/DirectionsRun';
import FitbitIcon from '@mui/icons-material/Fitbit';
import PoolIcon from '@mui/icons-material/Pool';
import ShieldIcon from '@mui/icons-material/Shield';

export const pages = [
    { href: "/facilities", label: "Facilities", icon: <SportsTennisIcon /> },
    { href: "/programmes", label: "Programmes", icon: <DirectionsRunIcon /> },
    { href: "/home", label: "Home", icon: <FitbitIcon /> },
    { href: "/buypass", label: "Buy Pass", icon: <PoolIcon /> },
    { href: "/gameon", label: "Game On", icon: <ShieldIcon /> },
];
